import styles from "./Header.module.css";
import HeaderCartButton from "./HeaderCartButton.js";
let Header = () => {
  return (
    <div className={styles.header}>
      <h2>React Meals</h2>
      <HeaderCartButton />
      <div className={styles["main-image"]}></div>
    </div>
  );
};
export default Header;
